import { StyleSheet } from 'react-native';

export default StyleSheet.create({
  container: {
    flexDirection: 'row',
  },

  countText: {
    fontSize: 16,
    paddingLeft: 15,
    paddingRight: 15,
    color: '#27AAE1',
  },

  count: {
    minWidth: 40,
    alignItems: 'center',
    justifyContent: 'center',
  }
});
